import React from 'react';
import Sdata from './Sdata';

const Footer = () => {
  return (
    <h3>
      {Sdata.map((item) => {
        return (
          <div>
            {item.data.map((ite)=>{
              return (
                <h1></h1>
              );
            })}
          </div>
        );
      })}
    </h3>
  );
};

export default Footer;
